lement", "properties": { "createTime": { "readOnly": true, "description": "Output only. The time at which the entitlement is created.", "type": "string", "format": "google-datetime" }, "updateTime": { "readOnly": true, "description": "Output only. The time at which the entitlement is updated.", "type": "string", "format": "google-datetime" }, "trialSettings": { "readOnly": true, "description": "Output only. Settings for trial offers.", "$ref": "GoogleCloudChannelV1alpha1TrialSettings" }, "offer": { "type": "string", "description": "Required. The offer resource name for which the entitlement is to be created. Takes the form: accounts/{account_id}/offers/{offer_id}." }, "provisioningState": { "readOnly": true, "enum": [ "PROVISIONING_STATE_UNSPECIFIED", "ACTIVE", "CANCELED", "COMPLETE", "PENDING", "SUSPENDED" ], "type": "string", "description": "Output only. Current provisioning state of the entitlement.", "enumDescriptions": [ "Not used.", "The entitlement is currently active.", "The entitlement was canceled. After an entitlement is `CANCELED`, its status will not change. Deprecated: Canceled entitlements will no longer be visible.", "The entitlement reached end of term and was not renewed. After an entitlement is `COMPLETE`, its status will not change. Deprecated: This is represented as ProvisioningState=SUSPENDED and suspensionReason in (TRIAL_ENDED, RENEWAL_WITH_TYPE_CANCEL)", "The entitlement is pending. Deprecated: This is represented as ProvisioningState=SUSPENDED and suspensionReason=PENDING_TOS_ACCEPTANCE", "The entitlement is currently suspended." ] }, "purchaseOrderId": { "type": "string", "description": "Optional. This purchase order (PO) information is for resellers to use for their company tracking usage. If a purchaseOrderId value is given, it appears in the API responses and shows up in the invoice. The property accepts up to 80 plain text characters. This is only supported for Google Workspace entitlements." }, "numUnits": { "type": "integer", "format